var cubeRotation = 0.0;

main();

//
// Start here
//

function main() {
  const canvas = document.querySelector('#glcanvas');
  const gl = canvas.getContext('webgl');
  let particleEmmitor = function(x, y, length, ttl, num_particles, speed, preburn){
    let particle = function(pos, vel, rad, color, time){
      this.start_pos = pos;
      this.pos = vec3.clone(pos);
      this.vel = vel;
      this.rad = rad;
      this.color = color;
      this.time = time;
      let dp = vec3.clone(vel);
      vec3.scale(dp, dp, time);
      vec3.add(this.pos, this.pos, dp);
    }
    this.particles = []
    for(let i = 0; i < num_particles; i++){
       let dir = (Math.random() - 0.5);
       let vel = vec3.fromValues((Math.random() - 0.5)  *speed, (Math.random() - 0.5)  *speed, 0);
       this.particles.push(new particle(vec3.fromValues(x + dir * length, y + (Math.random() - 0.5) / 3, 0),  vel, 0.05, vec4.fromValues(1, 1, 1, 1), (preburn? Math.random()  *ttl : 0.0)));
       this.ttl = ttl;
    }
    // for(let i = 0; i < num_particles * 0.2; i ++){
    //   let vel = vec3.create();
    //   vec3.random(vel, speed);
    //   this.particles.push(new particle(vec3.fromValues(x +  length  * ( i > num_particles  *0.9 ? 0.5 : -0.5), y, 0), vel, 0.05, vec4.fromValues(1, 1, 1, 1), (preburn? Math.random() * ttl : 0.0)));
    // }
    this.update = function(deltaT){
        for(let i = 0; i < this.particles.length; i ++){
          let dp = vec3.clone(this.particles[i].vel);          
            this.particles[i].time += deltaT;
            vec3.scale(dp, dp, this.particles[i].time);
            vec3.add(this.particles[i].pos, this.particles[i].start_pos, dp);
            if(this.particles[i].time > this.ttl){
              this.particles[i].time = Math.random()/ 10 - 0.05;
              this.particles[i].pos = vec3.clone(this.particles[i].start_pos);
            }
            this.particles[i].rad = 0.09 * Math.pow(0.7, this.particles[i].time);
        }
    }
  }


  emmiter = new particleEmmitor(0, 0, 4, 15, 2000, 0.15, true);
  canvas.setAttribute("height",  document.documentElement.clientHeight);
  canvas.setAttribute("width", document.documentElement.clientWidth);
  gl.viewport(0, 0, document.documentElement.clientWidth, document.documentElement.clientHeight);

  // If we don't have a GL context, give up now

  if (!gl) {
    alert('Unable to initialize WebGL. Your browser or machine may not support it.');
    return;
  }

  // Vertex shader program

  const vsSource = `
    attribute vec4 aVertexPosition;
    attribute vec2 aTextureCoord;
    attribute vec4 aNormal;
    uniform mat4 uWorldMatrix;
    uniform mat4 uViewMatrix;
    uniform mat4 uProjectionMatrix;
    uniform mat4 uNormMatrix;
    varying highp vec2 vTextureCoord;
    varying highp vec4 vNormal;
    varying highp vec4 vWorldPos;
    void main(void) {
      gl_Position = uProjectionMatrix * uViewMatrix * uWorldMatrix * aVertexPosition;
      vWorldPos = uWorldMatrix * aVertexPosition;
      vWorldPos = -normalize(vWorldPos);
      vTextureCoord = aTextureCoord;
      vNormal = normalize(uNormMatrix * aNormal);
    }
  `;

  // Fragment shader program

  const fsSource = `
    varying highp vec2 vTextureCoord;
    varying highp vec4 vNormal;
    varying highp vec4 vWorldPos;
    uniform sampler2D uSampler;
    uniform highp vec4 uColorMultiplier;
    uniform highp float uAmbient;
    void main(void) {
      highp vec4 texelColor = texture2D(uSampler, vTextureCoord);
      highp float light = uAmbient;
      light += max(0.0, dot(vNormal, vWorldPos) * 1.9);
      light = clamp(light, 0.0, 1.0);
      gl_FragColor = vec4(texelColor.rgb * uColorMultiplier.rgb * light, texelColor.a);
    }
  `;

  // Initialize a shader program; this is where all the lighting
  // for the vertices and so forth is established.
  const shaderProgram = initShaderProgram(gl, vsSource, fsSource);

  // Collect all the info needed to use the shader program.
  // Look up which attributes our shader program is using
  // for aVertexPosition, aVertexNormal, aTextureCoord,
  // and look up uniform locations.
  const programInfo = {
    program: shaderProgram,
    attribLocations: {
      vertexPosition: gl.getAttribLocation(shaderProgram, 'aVertexPosition'),
      textureCoord: gl.getAttribLocation(shaderProgram, 'aTextureCoord'),
      normal: gl.getAttribLocation(shaderProgram, "aNormal")
    },
    uniformLocations: {
      projectionMatrix: gl.getUniformLocation(shaderProgram, 'uProjectionMatrix'),
      viewMatrix: gl.getUniformLocation(shaderProgram, 'uViewMatrix'),
      worldMatrix: gl.getUniformLocation(shaderProgram, 'uWorldMatrix'),
      normalMatrix: gl.getUniformLocation(shaderProgram, 'uNormMatrix'),
      uSampler: gl.getUniformLocation(shaderProgram, 'uSampler'),
      uColorMultiplier: gl.getUniformLocation(shaderProgram, 'uColorMultiplier'),
      uAmbient: gl.getUniformLocation(shaderProgram,'uAmbient' ),
    },
  };

  // Here's where we call the routine that builds all the
  // objects we'll be drawing.
  const buffers = initBuffers(gl);

  const texture = loadTexture(gl, 'particle.png');
  const sign = loadTexture(gl, 'sign.png');
  const background = loadTexture(gl, 'background.jpg');
  const mars = loadTexture(gl, "mars.jpg");
  var then = 0;

  // Draw the scene repeatedly
  function render(now) {
    now *= 0.001;  // convert to seconds
    const deltaTime = now - then;
    then = now;

    drawScene(gl, programInfo, buffers, texture, emmiter, deltaTime, sign, background, mars);

    requestAnimationFrame(render);
  }
  requestAnimationFrame(render);
}

